    function update(address user)public {
        uint256 difference = block.number.sub(_mineInfo[user][1]).add(1);
        uint256 start = MineStatus(_mineInfo[user][1]);
        uint256 end = MineStatus(block.number);
        uint256 a = start.add(end).mul(difference).div(2);

        uint dcf_amount = a.mul(_mineInfo[user][2]).div(_totalPower);
        _mineInfo[user][3] = _mineInfo[user][3].add(dcf_amount);
       
    }

   


